import Link from "next/link";

export default function NavBar() {
  return (
    <div style={style}>
      <Link href='/About'>
        <button>About</button>
      </Link>
      <Link href='/'>
        <button>Home</button>
      </Link>
    </div>
  );
}
const style = {
  width: "100%",
  height: "30px",
  margin: "0px",
  padding: "2px 1.2rem",
  backgroundColor: "red",
  color: "white",
  display: "flex",
  justifyContent: "space-around",
};
